CLI commands are useful beyond just the dev console. They are effectively named Bevy systems that you can run by name. If you want to run a CLI command from Rust, you can do so. Using Commands (yes, the regular bevy kind), from a Bevy system: fn my_system( mut commands: Commands,
) { // provide exactly the same string as you would in the devconsole prompt commands.run_clicommand("dothing arg 1.0 2.0 3.0"); commands.run_clicommand("hello");
} This will queue up your CLI to run whenever Bevy Commands get applied next. If you have direct World access (from a Bevy exclusive system): fn my_system( world: &mut World,
) { world.run_clicommand("dothing blah blah");
} This will run the CLI immediately.

