Noargs commands are bare Bevy systems: fn cli_mything( mut commands: Commands, my_query: Query<&Thing>, my_res: Res<&MyThing>, // ...
) { // ... do something ...
} We can register it as follows: app.register_clicommand_noargs("mything", cli_mything); You provide the name string that users will have to type in the console to invoke the command, and the function (bevy system) that implements the command. They don't have to match. You can then call it from the Dev Console as such: mything

