Args commands must start with a special In parameter, which is how they get the values of the arguments provided via the dev console / script: fn cli_mything( In(args): In<Vec<String>>, // bevy system params follow: my_query: Query<&Thing>, // ...
) { // we can now process/parse the args: if args.len() != 1 { error!("Expected exactly 1 argument!"); return; } let Ok(value) = args[0].parse::<f32>() { error!("Expected a numeric value as an argument!"); return; } // ... do something with `value` and `my_query` or whatever
} (note: the engine only splits the CLI string on spaces and does not do any extra processing for you. Your function must take In<Vec<String>>.) (also note: the name of the command itself is not included in that Vec. args[0] contains the first CLI argument, after the space separator) We can register it as follows: app.register_clicommand_args("mything", cli_mything); You provide the name string that users will have to type in the console to invoke the command, and the function (bevy system) that implements the command. They don't have to match. You can then call it from the Dev Console as such: mything 1.0

