Say we register the following commands: app.register_clicommand_args("dothing", cli_dothing);
app.register_clicommand_args("hello", cli_hello_args);
app.register_clicommand_noargs("hello", cli_hello_noargs);
app.register_clicommand_noargs("exit", cli_exit); Here is what will happen if you type different things in the dev console: exit Will run the cli_exit Bevy system. exit blah Error: command not found. (because no args command with the name exit exists) hello Will run the cli_hello_noargs Bevy system. hello world Will run the cli_hello_args Bevy system and pass in vec!["world"] as the In parameter. dothing Error: command not found. (because no noargs command with the name dothing exists, it doesn't matter that an args command with that name exists) dothing 10.5 Will run the cli_dothing Bevy system and pass in vec!["10.5"] as the In parameter. Note that the argument is always passed in as a string. The Rust function must do any processing it wants, such as parsing it into a f32 number, if that is what it expects.
